import React from 'react';
import s from 'Post.module.css'

const Post = ({post}) => {
    return (
        <div className={s.post}>
            <div className={s.post_content}>

            </div>
            <h2>{post.title}</h2>
            <div>
                {post.body}
            </div>
        </div>
    );
};

export default Post;
